import React from "react";
import {XboxGameClips} from "../service/XboxGameClips";

function ClipsPage(){
    const [fetchClips, isFetchingClips] = useState('');
    const fetchGamClips = async ()=>{
        try{
            const gameClips = await XboxGameClips();
            if(gameClips.length === 0){
                console.log("No game clips found.");
            }
        }catch(error){
            console.error(error);
        }
    }
    return (
        <div>
            <h1>Clips Page</h1>
        </div>
    );
}

export default ClipsPage;
